import React, { PureComponent } from 'react';




export default class ExpertsManagement extends PureComponent {
    constructor(props) {
        super(props);
        this.state = {
            names: [],
            gender: ["男", "女", "男"],
            teleNum: ["132XXXX0000", "132XXXX1111", "133XXXX5678"],
            typeBeGoodAt: [
                "社会安全事件；公共卫生事件；自然灾害事件；事故性灾难事件；文物安全事件；",
                "自然灾害事件；文物安全事件；事故性灾难事件；社会安全事件；公共卫生事件；",
                "自然灾害事件；文物安全事件；事故性灾难事件；社会安全事件；公共卫生事件；"
            ],
        };
    }
    getName(){
		let name = this.state.names;
		for(let i=0;i<99;i++){
			name.push("XXX名称"+i);
		}
		this.setState({
			names: name
		})
	}
    render() {
        return (
            <div style={{color:'red'}}>{this.state.name}</div>
        )
    }
}
